INSERT INTO `whatsns_topic` VALUES (4,'宁波市教育培训行业促进会成立暨第一次会员代表大会举行','\r\n                                    \r\n                                    \r\n                                    \r\n                                    \r\n                                    \r\n                                    \r\n                                    \r\n                                    \r\n                                    \r\n                                    \r\n                                    \r\n                                    \r\n                                 <section><section><section><section><section><section><section><section><p>9月20日，宁波市教育培训行业促进会成立暨第一次会员代表大会举行。市委教育工委委员、市教育局副局长张建国、市消防支队林辉处长共同为宁波市教育培训行业促进会揭牌。大会选举产生了第一届理事会会长、副会长、秘书长和监事，审议通过了促进会章程和理事会各项制度。</p><p><br></p></section></section></section></section></section></section></section></section><p>今年4月，宁波乐恩教育、新东方、学而思培优、学大教育等4家培训机构联合发起筹设宁波市教育培训行业促进会，经充分酝酿和论证，报市教育局审核同意，市民政局正式批复成立。</p><p>据悉，目前全市经教育部门审批的民办教育培训机构共有960家。市教育局副局长张建国表示，刚出台的《宁波市民办非学历教育培训机构审批与管理暂行办法》和即将出台的《宁波市民办学校分类登记管理实施办法》，将进一步完善我市校外培训机构设置的具体标准，为扎实推进整改工作提供依据。</p><p>张建国表示，教育培训机构要规范办学，诚信办学，教育培训行业促进会的成立，有助于健全我市教育培训行业治理结构，制定行业标准，促进行业自律，协助行业整治，推进行业信用体系建设，进一步规范培训市场，保护消费者的合法权益。</p><p><img src=\"http://47.100.76.23/data/attach/1809/p66gySD6.jpg\" alt=\"微信图片_20180921173831\"><br></p><section><section><section><section><section><section><p>&nbsp; &nbsp; &nbsp;下一步，该促进会将加大依法办学政策法规和制度精神的宣传，开展办学行为巡查；创新教育培训行业管理理念，延伸管理幅度，破解治理难题；建立行业规范，实现自我管理和自我约束；收集行业信息，发布行业报告，提供业务指导，面向社会开展培训、交流、展示等活动；维护消费者权益，协调处理家长投诉，提供行业仲裁。</p></section></section></section></section></section></section><p></p><p>市教育局、市民政局、市消防支队以及各区县（市）教育行政部门的有关领导和首批会员代表等180余人出席了成立大会。</p><p><br></p><p>数据来源：宁波教育</p>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                <p><br></p>                                                                                                                                                                                                                                                        ','http://47.100.76.23/data/attach/topic/topic8f6QYC.jpg',0,'admin',1,42,118,0,1537522763,0,0,0,0,1,1,''),(5,'关于进一步规范全市校外培训机构办学行为的通知','\r\n                                    \r\n                                    \r\n                                    \r\n                                    \r\n                                    \r\n                                    \r\n                                    \r\n                                    \r\n                                 <p>为深入贯彻落实国务院办公厅《关于规范校外培训机构&nbsp;发展的意见》（国办发〔2018〕80&nbsp;号）文件精神，结合《宁波市中小学生校外培训机构专项治理行动方案》（甬教&nbsp;〔2018〕165&nbsp;号）以及《关于要求民办教育培训机构严格遵守相关规定的通知》&nbsp;（甬教终民〔2017〕116&nbsp;号）等要求，现就进一步规范全市校外培训机构办学行为通知如下：</p><p>一、严格规范收费管理。</p><p>一是收费时段与教学安排应协&nbsp;调一致，不得一次性收取时间跨度超过&nbsp;3&nbsp;个月的费用。收取费用时，须及时入学校帐户，并向学生开具合法票据。新的学期周期按照国家的最新要求执行，原有的收费合同在履约结束后按新的要求执行。二是收费项目及标准要通过宁波民&nbsp;办教育网（http://mbjy.nbedu.net.cn/）等途径向社会公示，并在办学场所显著位置公示办学许可证、法人登记证书（营业执照）、收费项目及标准、退费规定等，接受物价、教育、市场监管等有关部门的监督。三是严禁利用第三方信贷等方式诱导、误导学生或学生家长，进行预缴预存优惠报名、第三方信贷分期付款等违规收费现象。四是培训机构必须与学&nbsp;员(未成年人的监护人)签订培训合同。合同内容应当明确师资、收费、退费、违约责任和争议解决方式等事项。</p><p>二、完善招生简章和广告备案。</p><p>培训机构应实事求是地制订招生简章、制作招生广告，向审批机关备案并向社会公示，自觉接受监督。严禁夸大培训效果，发布不实虚假广告宣传误导消费者。如发现实际招生过程中与备案不符，依法&nbsp;进行查处。9&nbsp;月份，全市开展校外培训机构招生简单和广告&nbsp;备案工作，各机构按要求登录宁波民办教育网“用户登录”端口进行备案。各级教育部门将对备案情况进行核查。</p><p>三、严把师资准入关。</p><p>培训机构必须有相对稳定的师资队伍，不得聘用中小学在职教师。从事语文、数学、英语及科学（物理、化学、生物）等学科知识培训的教师应具有教师资格证书。聘用外籍人员须符合国家有关规定。外教要在宁波从事英语教学工作，则应来自母语为英语的国家，必须持有宁波市外国专家局签发的工作许可证，且工作许可证必须在有效期限内。</p><p>四、维护正常的教育教学秩序。</p><p>培训机构不得以排名、获奖情况发布等任何形式，介入全日制中小学校招生；不得公布或向第三方提供学前、义务教育段学生的考（测）试成绩、名次，严禁向第三方提供学员个人信息和家庭信息；不得通过机构网站、机构微信微博账号等载体，转发全日制中小学发布的招生信息、开放日活动信息等。</p><p>五、落实安全主体责任。</p><p>按照“谁举办、谁负责”的原则，培训机构要落实安全主体责任，切实增强安全意识，加强安全管理，建立健全安全管理工作制度和安全事故应急预案，配备专、兼职安全监督人员，配齐配足安全设施设备，切实履行学生安全事项告知提醒义务。</p><p>各区县（市）教育局要督促区域内校外培训机构马上&nbsp;开展自查，并将自查报告于&nbsp;9&nbsp;月底前报教育局。各区县（市）教育局也要就区域内校外培训机构的自查情况形成书面材&nbsp;料并报市教育局。9&nbsp;月份，我市将启动民办教育培训机构诚信办学星级评估工作。这些规范办学的要求将作为诚信办学星级评估的重要内容。下一阶段，教育部门要联合市场监管、民政、物价、税务、消防等部门对校外培训机构办学行为进行联合检查，对未公示收费项目和标准、招生简单和广告未备案、学科类教师未持证上岗、消防安全存在隐患等行为，依法依规严肃处理，直至吊销办学许可证。</p><p><br></p><p>数据来源：宁波市教育局</p><p><br></p><p><img src=\"http://47.100.76.23/data/attach/1809/xBJJwXwR.png\" alt=\"微信截图_20180921200952\"><img src=\"http://47.100.76.23/data/attach/1809/XBxM0hEY.png\" alt=\"微信截图_20180921201018\"><img src=\"http://47.100.76.23/data/attach/1809/prBmy6OG.png\" alt=\"微信截图_20180921201040\"><br></p>                                                                                                                                                                                                                                                                                                                      <p><br></p>','http://47.100.76.23/data/attach/topic/topicDzfJQ0.jpg',0,'admin',1,67,119,0,1537532011,0,0,0,0,1,1,''),(6,'国务院办公厅关于规范校外培训机构发展的意见','\r\n                                    \r\n                                    \r\n                                 <p>一、总体要求<br></p><p>（一）指导思想。以习近平新时代中国特色社会主义思想为指导，深入贯彻落实党的十九大和十九届二中、三中全会精神，全面贯彻党的教育方针，坚持立德树人，发展素质教育，以促进中小学生身心健康发展为落脚点，以建立健全校外培训机构监管机制为着力点，努力构建校外培训机构规范有序发展的长效机制，切实解决人民群众反映强烈的中小学生课外负担过重问题，形成校内外协同育人的良好局面。</p><p>（二）基本原则。</p><p>依法规范。依法依规对校外培训机构进行审批登记、开展专项治理、强化日常监管，切实规范校外培训秩序。校外培训机构依法依规开展培训业务和相关活动，自觉维护中小学生及家长合法权益。</p><p>分类管理。鼓励发展以培养中小学生兴趣爱好、创新精神和实践能力为目标的培训，重点规范语文、数学、英语及物理、化学、生物等学科知识培训，坚决禁止应试、超标、超前培训及与招生入学挂钩的行为。</p><p>综合施策。统筹学校、社会和家庭教育，既规范校外培训机构培训行为，又同步改进中小学教育教学，提高学校教育质量和课后服务能力，强化学校育人主体地位，积极推动家长转变教育观念，做到标本兼治、务求实效。</p><p>协同治理。强化省地（市）统筹，落实以县为主管理责任。建立健全工作协调机制，有关部门各司其职、分工协作，统筹做好审批登记和监督管理，形成综合治理合力，确保积极稳妥推进。</p><p>二、明确设置标准</p><p>（三）确定设置标准。省级教育部门要会同有关部门，结合本地实际，研究制订校外培训机构设置的具体标准；省域内各地市差距大的，可授权地市级教育部门会同当地有关部门制订，并向省级教育部门及有关部门备案。</p><p>（四）遵循基本要求。各地标准必须达到以下基本要求。场所条件方面，校外培训机构必须有符合安全条件的固定场所，同一培训时段内生均面积不低于3平方米，确保不拥挤、易疏散；必须符合国家关于消防、环保、卫生、食品经营等管理规定要求。通过为参训对象购买人身安全保险等必要方式，防范和化解安全事故风险。师资条件方面，校外培训机构必须有相对稳定的师资队伍，不得聘用中小学在职教师。所聘从事培训工作的人员必须遵守宪法和法律，热爱教育事业，具有良好的思想品德和相应的培训能力；从事语文、数学、英语及物理、化学、生物等学科知识培训的教师应具有相应的教师资格。培训机构应当与所聘人员依法签订聘用合同、劳动合同或劳务协议。聘用外籍人员须符合国家有关规定。管理条件方面，校外培训机构必须坚持和加强党的领导，做到党的建设同步谋划、党的组织同步设置、党的工作同步开展，确保正确的办学方向。必须有规范的章程和相应的管理制度，明确培训宗旨、业务范围、议事决策机制、资金管理、保障条件和服务承诺等。</p><p>三、依法审批登记</p><p>（五）确保证照齐全。校外培训机构必须经审批取得办学许可证后，登记取得营业执照（或事业单位法人证书、民办非企业单位登记证书，下同），才能开展培训。已取得办学许可证和营业执照的，如不符合设置标准，应当按标准要求整改，整改不到位的要依法吊销办学许可证，终止培训活动，并依法办理变更或注销登记。</p><p>（六）严格审批登记。校外培训机构审批登记实行属地化管理。县级教育部门负责审批颁发办学许可证，未经教育部门批准，任何校外培训机构不得以家教、咨询、文化传播等名义面向中小学生开展培训业务。校外培训机构在同一县域设立分支机构或培训点的，均须经过批准；跨县域设立分支机构或培训点的，需到分支机构或培训点所在地县级教育部门审批。中小学校不得举办或参与举办校外培训机构。</p><p>四、规范培训行为</p><p>（七）细化培训安排。校外培训机构开展语文、数学、英语及物理、化学、生物等学科知识培训的内容、班次、招生对象、进度、上课时间等要向所在地县级教育部门备案并向社会公布；培训内容不得超出相应的国家课程标准，培训班次必须与招生对象所处年级相匹配，培训进度不得超过所在县（区）中小学同期进度。校外培训机构培训时间不得和当地中小学校教学时间相冲突，培训结束时间不得晚于20∶30，不得留作业；严禁组织举办中小学生学科类等级考试、竞赛及进行排名。</p><p>（八）践行诚实守信。校外培训机构应实事求是地制订招生简章、制作招生广告，向审批机关备案并向社会公示，自觉接受监督。要认真履行服务承诺，杜绝培训内容名不符实。不得以暴力、威胁等手段强迫学生接受培训。要不断改进教育教学，提高培训质量，努力提升培训对象满意度。</p><p>（九）规范收费管理。严格执行国家关于财务与资产管理的规定，收费时段与教学安排应协调一致，不得一次性收取时间跨度超过3个月的费用。各地教育部门要加强与金融部门的合作，探索通过建立学杂费专用账户、严控账户最低余额和大额资金流动等措施加强对培训机构资金的监管。培训机构收费项目及标准应当向社会公示，并接受有关部门的监督，不得在公示的项目和标准外收取其他费用，不得以任何名义向培训对象摊派费用或者强行集资。对于培训对象未完成的培训课程，有关退费事宜严格按双方合同约定以及相关法律规定办理。</p><p>五、强化监督管理</p><p>（十）完善日常监管。各地要切实加强对校外培训机构办学行为的日常监管，坚持谁审批谁监管、谁主管谁监管，防止重审批轻监管，健全监管责任体系和工作机制，切实加强监管队伍建设。教育部门负责查处未取得办学许可证违法经营的机构，并在做好办学许可证审批工作基础上，重点做好培训内容、培训班次、招生对象、教师资格及培训行为的监管工作，牵头组织校外培训市场综合执法；市场监管部门重点做好相关登记、收费、广告宣传、反垄断等方面的监管工作；人力资源社会保障部门重点做好职业培训机构未经批准面向中小学生开展培训的监管工作；机构编制、民政部门重点做好校外培训机构违反相关登记管理规定的监管工作；公安、应急管理、卫生、食品监管部门重点做好校外培训机构的安全、卫生、食品条件保障的监管工作；网信、文化、工业和信息化、广电部门在各自职责范围内配合教育部门做好线上教育监管工作。</p><p>（十一）落实年检年报制度。县级教育部门要会同有关部门按照校外培训机构设置标准、审批条件、办学行为要求和登记管理有关规定完善管理办法，认真组织开展年检和年度报告公示工作。在境外上市的校外培训机构向境外公开披露的定期报告及对公司经营活动有重大不利影响的临时报告等信息，应以中文文本在公司网站（如无公司网站，应在证券信息披露平台）向境内同步公开、接受监督。对经年检和年报公示信息抽查检查发现校外培训机构隐瞒实情、弄虚作假、违法违规办学，或不接受年检、不报送年度报告的，要依法依规严肃处理，直至吊销办学许可证，追究有关人员的法律责任。</p><p>（十二）公布黑白名单。全面推行白名单制度，对通过审批登记的，在政府网站上公布校外培训机构的名单及主要信息，并根据日常监管和年检、年度报告公示情况及时更新。各地可根据校外培训机构的设置和管理要求，建立负面清单。对已经审批登记，但有负面清单所列行为的校外培训机构，应当及时将其从白名单上清除并列入黑名单；对未经批准登记、违法违规举办的校外培训机构，予以严肃查处并列入黑名单。将黑名单信息纳入全国信用信息共享平台，按有关规定实施联合惩戒。将营利性校外培训机构的行政许可信息、行政处罚信息、黑名单信息、抽查检查结果等归集至国家企业信用信息公示系统，记于相对应企业名下并依法公示。对于非营利性校外培训机构的失信行为，依据社会组织信用信息管理有关规定进行信用管理并依法公示。</p><p>六、提高中小学育人能力</p><p>（十三）提升教学质量。切实加强中小学师德师风建设，鼓励广大教师为人师表、潜心教书育人。中小学校必须严格按照国家发布的课程方案、课程标准和学校教学计划，开足、开齐、开好每门课程。各地教育部门要指导中小学校，按照学校管理有关标准对标研判、依标整改，严格规范教育教学行为，努力提高教育教学质量，为切实减轻中小学生课外负担创造条件。坚持依法从严治教，对中小学校不遵守教学计划、“非零起点教学”等行为，要坚决查处并追究有关校长和教师的责任；对中小学教师“课上不讲课后到校外培训机构讲”、诱导或逼迫学生参加校外培训机构培训等行为，要严肃处理，直至取消有关教师的教师资格。</p><p>（十四）严明入学纪律。严肃中小学招生入学工作纪律，坚决禁止中小学校与校外培训机构联合招生，坚决查处将校外培训机构培训结果与中小学校招生入学挂钩的行为，并依法追究有关学校、校外培训机构和相关人员责任。</p><p>（十五）做好课后服务。各地要创造条件、加大投入、完善政策，强化中小学校在课后服务中的主渠道作用，普遍建立弹性离校制度。中小学校要充分挖掘学校师资和校舍条件的潜力，并积极利用校外资源，充分发挥家长委员会的作用，努力开辟多种适宜的途径，帮助学生培养兴趣、发展特长、开拓视野、增强实践，不断提高课后服务水平，可为个别学习有困难的学生提供免费辅导。坚决防止课后服务变相成为集体教学或补课。各地可根据课后服务性质，采取财政补贴、收取服务性收费或代收费等方式筹措经费。有关部门在核定绩效工资总量时，应当适当考虑学校和单位开展课后服务因素；学校和单位在核定的绩效工资总量内，对参与课后服务的教师给予适当倾斜。设定服务性收费或代收费的，应当坚持成本补偿和非营利原则，按有关规定由省级教育部门和价格主管部门联合报省级人民政府审定后执行。中小学生是否参加课后服务，由学生和家长自愿选择，严禁各地以课后服务名义乱收费。</p><p>七、加强组织领导</p><p>（十六）健全工作机制。各地要切实提高思想认识，将规范校外培训机构发展纳入重要议事日程。建立由教育部门牵头、有关部门参与的联席会议制度，制订详细的工作方案，细化分工、压实责任、大力推进。及时总结经验，研究新情况、新问题，不断改进政策措施。充分发挥相关行业协会在行业发展、规范、自律等方面的作用。注重多方联动，发展社区功能，加强少年宫、实践基地等场馆建设，多渠道满足中小学生的个性化需求，形成学校、家庭、社会育人合力。</p><p>（十七）做实专项治理。各地要开展好校外培训机构专项治理工作，进行全面摸排，认真建立工作台账，完善分类管理，对存在问题的培训机构逐一整改到位。要加大工作督促指导力度，通过开展自查、交叉检查、专项督查等方式，确保专项治理取得实际成效。</p><p>（十八）强化问责考核。教育督导部门要加强对地方政府规范校外培训机构发展工作的督导评估，评估结果作为有关领导干部综合考核评价的重要参考。建立问责机制，对责任不落实、措施不到位，造成中小学生课外负担过重，人民群众反映特别强烈的地方及相关责任人要进行严肃问责。规范治理校外培训机构及减轻中小学生课外负担不力的县（区），不得申报义务教育基本均衡和优质均衡发展评估认定；已经通过认定的，要下发专项督导通知书，限期整改。</p><p>（十九）重视宣传引导。各地要通过多种途径加强政策宣传解读，使改革精神、政策要义家喻户晓，形成良好社会氛围。通过家长会、家长学校、家访、专题报告等形式，促进家长树立正确的教育观念、成才观念，不盲目攀比，科学认识并切实减轻学生过重的课外负担。对表现突出的校外培训机构给予宣传，引导校外培训机构增强社会责任担当，强化自我约束，树立良好社会形象。</p><p><br></p><p>数据来源：国务院文件&nbsp;<a href=\"http://www.gov.cn/zhengce/content/2018-08/22/content_5315668.htm\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255);\">http://www.gov.cn/zhengce/content/2018-08/22/content_5315668.htm</a></p><p><br></p>                                                                                                                            ','http://47.100.76.23//data/attach/topic/topictszZCk.png',0,'admin',1,18,119,0,1537532312,0,0,0,0,1,1,''),(7,'宁波市教育局突击检查11家教育培训机构，2家无证经营被停办','\r\n                                    \r\n                                    \r\n                                 <p>8月29日，市教育局联合市场监管局、市消防支队、市税务局、市物价局等部门，对宁波11家校外培训机构进行了突击检查。</p><p><br></p><p>在鄞州区世纪东方广场，执法人员对宁波鄞州区英拓培训学校、瑞思学科英语、杨之红艺术培训学校、英孚青少儿英语、吾微英文学校等7家培训机构进行突击检查，发现这7家机构证照齐全，总体情况良好。</p><p>但部分机构存在收费标准和办学许可证未在显著位置公示、场所内外机构名称不一致等问题，执法人员现场一一指出，督促培训机构立即改正。</p><p><a href=\"http://www.nbedu.gov.cn/picture/0/77f204253aa7446cab776d0f3ae19bd9.jpg\" target=\"_blank\"><img alt=\"http://www.nbedu.gov.cn/picture/0/s_77f204253aa7446cab776d0f3ae19bd9.jpg\" src=\"http://www.nbedu.gov.cn/picture/0/s_77f204253aa7446cab776d0f3ae19bd9.jpg\"></a></p><p>“南学国际”位于东部新城金融硅谷10号楼21层，执法人员进入时，发现这是一家从事出国留学服务和教育培训的机构。几位工作人员正在办公，当被要求查看机构工商登记及民办教育办学许可时，工作人员表示并不知道放在哪里。</p><p>机构内部有几间课堂，有一位年轻培训老师正在给学员上英文课。执法人员判断，这是一家正在营业的培训机构，那么，它是否具有办学资质呢?执法人员辗转联系到了该机构陈姓负责人，陈某称，这家“南学国际”培训机构正在收购某培训集团，目前并没有办学的相关证照，但已在办理中。</p><p>　　&nbsp;<a href=\"http://www.nbedu.gov.cn/picture/0/931739f564634324b86a96051f195d0e.jpg\" target=\"_blank\"><img alt=\"http://www.nbedu.gov.cn/picture/0/s_931739f564634324b86a96051f195d0e.jpg\" src=\"http://www.nbedu.gov.cn/picture/0/s_931739f564634324b86a96051f195d0e.jpg\"></a>&nbsp;</p><p>　　(“南学国际”正在开展教育培训)</p><p><br></p><p>未取得教育部门颁发的民办教育办学许可的情况下营业，显然这是一家非法办学机构。</p><p>为此，鄞州区教育局工作人员现场出具“停止办学通知书”，责令该机构马上停止办学，并在接到通知15天内到教育局办理审批手续。并禁止其在整改期间进行教学活动。</p><p>进入金融硅谷10号楼14层的“天分教育”，执法人员发现这是一家从事初小学生文化课培训的校外机构。几间课室里并没有学生，整家机构只有一个工作人员在场。通过该工作人员，执法人员电话联系到了“天分教育”负责人。该负责人称，目前这里已不是教育培训机构了，而是一家教育咨询公司。</p><p>　　<a href=\"http://www.nbedu.gov.cn/picture/0/46f5c8d3f2c2490db9116d72cfc2cf02.jpg\" target=\"_blank\"><img alt=\"http://www.nbedu.gov.cn/picture/0/s_46f5c8d3f2c2490db9116d72cfc2cf02.jpg\" src=\"http://www.nbedu.gov.cn/picture/0/s_46f5c8d3f2c2490db9116d72cfc2cf02.jpg\"></a></p><p>然而，执法人员在机构前台看到了“天分教育2018秋季班课程表”，上面清晰列明各个年级学员的培训科目及时间，“很明显，这是一家正在营业的初小文化课校外培训机构。”市教育局终身教育与民办教育处负责人说。</p><p>因未经审批擅自办学违反《中华人民共和国民办教育促进法》，现场，鄞州区教育局对“天分教育”出具了“停止办学通知书”。</p><p>　<a href=\"http://www.nbedu.gov.cn/picture/0/7112acf75008421f9445ec2095590b8c.jpg\" target=\"_blank\"><img alt=\"http://www.nbedu.gov.cn/picture/0/s_7112acf75008421f9445ec2095590b8c.jpg\" src=\"http://www.nbedu.gov.cn/picture/0/s_7112acf75008421f9445ec2095590b8c.jpg\"></a></p><p>&nbsp;市教育局终身教育与民办教育处负责人表示，下一步市教育局将联合各相关部门，加强对校外培训机构的监督。培训机构尤其要严格规范收费管理，保证收费时段与教学安排协调一致，不得一次性收取时间跨度超过3个月的费用。</p><p><br></p><p>温馨提示</p><p>希望广大学生、家长树立正确的教育观念，理性看待参加校外培训的作用，不要盲目攀比，切实维护自身合法权益。</p><p></p><p>广大家长在给孩子选择培训机构时，应首先确认机构是否具有教育培训办学许可证书，如发现问题可拨打89183287向教育部门举报。</p><p><br></p><p>数据来源：宁波民办教育</p>                                                                                                                            ','http://47.100.76.23/data/attach/topic/topickzkBtu.jpg',0,'admin',1,10,119,0,1537574832,0,0,0,0,1,1,''),(8,'财政部税务总局对非营利民办学校免税的规定','\r\n                                    \r\n                                    \r\n                                    \r\n                                 <p>财政部税务总局对非营利民办学校免税的规定</p><p>财税〔2018〕13号</p><p><br></p><p>&nbsp;各省、自治区、直辖市、计划单列市财政厅（局）、国家税务局、地方税务局，新疆生产建设兵团财政局：</p><p>根据《中华人民共和国企业所得税法》第二十六条及《中华人民共和国企业所得税法实施条例》第八十四条的规定，现对非营利组织免税资格认定管理有关问题明确如下：</p><p>一、依据本通知认定的符合条件的非营利组织，必须同时满足以下条件：</p><p>（一）依照国家有关法律法规设立或登记的事业单位、社会团体、基金会、社会服务机构、宗教活动场所、宗教院校以及财政部、税务总局认定的其他非营利组织；</p><p>（二）从事公益性或者非营利性活动；</p><p>（三）取得的收入除用于与该组织有关的、合理的支出外，全部用于登记核定或者章程规定的公益性或者非营利性事业；</p><p>（四）财产及其孳息不用于分配，但不包括合理的工资薪金支出；</p><p>（五）按照登记核定或者章程规定，该组织注销后的剩余财产用于公益性或者非营利性目的，或者由登记管理机关采取转赠给与该组织性质、宗旨相同的组织等处置方式，并向社会公告；</p><p>（六）投入人对投入该组织的财产不保留或者享有任何财产权利，本款所称投入人是指除各级人民政府及其部门外的法人、自然人和其他组织；</p><p>（七）工作人员工资福利开支控制在规定的比例内，不变相分配该组织的财产，其中：工作人员平均工资薪金水平不得超过税务登记所在地的地市级（含地市级）以上地区的同行业同类组织平均工资水平的两倍，工作人员福利按照国家有关规定执行；</p><p>（八）对取得的应纳税收入及其有关的成本、费用、损失应与免税收入及其有关的成本、费用、损失分别核算。</p><p>二、经省级（含省级）以上登记管理机关批准设立或登记的非营利组织，凡符合规定条件的，应向其所在地省级税务主管机关提出免税资格申请，并提供本通知规定的相关材料；经地市级或县级登记管理机关批准设立或登记的非营利组织，凡符合规定条件的，分别向其所在地的地市级或县级税务主管机关提出免税资格申请，并提供本通知规定的相关材料。</p><p>财政、税务部门按照上述管理权限，对非营利组织享受免税的资格联合进行审核确认，并定期予以公布。</p><p><font color=\"#008080\">三、申请享受免税资格的非营利组织，需报送以下材料：</font></p><p>（一）申请报告；</p><p>（二）事业单位、社会团体、基金会、社会服务机构的组织章程或宗教活动场所、宗教院校的管理制度；</p><p>（三）非营利组织注册登记证件的复印件；</p><p>（四）上一年度的资金来源及使用情况、公益活动和非营利活动的明细情况；</p><p>（五）上一年度的工资薪金情况专项报告，包括薪酬制度、工作人员整体平均工资薪金水平、工资福利占总支出比例、重要人员工资薪金信息（至少包括工资薪金水平排名前10的人员）；</p><p>（六）具有资质的中介机构鉴证的上一年度财务报表和审计报告；</p><p>（七）登记管理机关出具的事业单位、社会团体、基金会、社会服务机构、宗教活动场所、宗教院校上一年度符合相关法律法规和国家政策的事业发展情况或非营利活动的材料；</p><p>（八）财政、税务部门要求提供的其他材料。</p><p>当年新设立或登记的非营利组织需提供本条第（一）项至第（三）项规定的材料及本条第（四）项、第（五）项规定的申请当年的材料，不需提供本条第（六）项、第（七）项规定的材料。</p><p><font color=\"#ff0000\">四、非营利组织免税优惠资格的有效期为五年。非营利组织应在免税优惠资格期满后六个月内提出复审申请，不提出复审申请或复审不合格的，其享受免税优惠的资格到期自动失效。</font></p><p>非营利组织免税资格复审，按照初次申请免税优惠资格的规定办理。</p><p>五、非营利组织必须按照《中华人民共和国税收征收管理法》及《中华人民共和国税收征收管理法实施细则》等有关规定，办理税务登记，按期进行纳税申报。取得免税资格的非营利组织应按照规定向主管税务机关办理免税手续，免税条件发生变化的，应当自发生变化之日起十五日内向主管税务机关报告；不再符合免税条件的，应当依法履行纳税义务；未依法纳税的，主管税务机关应当予以追缴。取得免税资格的非营利组织注销时，剩余财产处置违反本通知第一条第五项规定的，主管税务机关应追缴其应纳企业所得税款。</p><p>有关部门在日常管理过程中，发现非营利组织享受优惠年度不符合本通知规定的免税条件的，应提请核准该非营利组织免税资格的财政、税务部门，由其进行复核。</p><p>核准非营利组织免税资格的财政、税务部门根据本通知规定的管理权限，对非营利组织的免税优惠资格进行复核，复核不合格的，相应年度不得享受税收优惠政策。</p><p><font color=\"#0000ff\">六、已认定的享受免税优惠政策的非营利组织有下述情形之一的，应自该情形发生年度起取消其资格：</font></p><p>（一）登记管理机关在后续管理中发现非营利组织不符合相关法律法规和国家政策的；</p><p>（二）在申请认定过程中提供虚假信息的；</p><p>（三）纳税信用等级为税务部门评定的C级或D级的；</p><p>（四）通过关联交易或非关联交易和服务活动，变相转移、隐匿、分配该组织财产的；</p><p>（五）被登记管理机关列入严重违法失信名单的；</p><p>（六）从事非法政治活动的。</p><p>因上述第（一）项至第（五）项规定的情形被取消免税优惠资格的非营利组织，财政、税务部门自其被取消资格的次年起一年内不再受理该组织的认定申请；因上述第（六）项规定的情形被取消免税优惠资格的非营利组织，财政、税务部门将不再受理该组织的认定申请。</p><p>被取消免税优惠资格的非营利组织，应当依法履行纳税义务；未依法纳税的，主管税务机关应当自其存在取消免税优惠资格情形的当年起予以追缴。</p><p>七、各级财政、税务部门及其工作人员在认定非营利组织免税资格工作中，存在违法违纪行为的，按照《公务员法》《行政监察法》等国家有关规定追究相应责任；涉嫌犯罪的，移送司法机关处理。</p><p>八、本通知自2018年1月1日起执行。《财政部 国家税务总局关于非营利组织免税资格认定管理有关问题的通知》（财税〔2014〕13号）同时废止。<br></p><p><br></p><p>数据来源：中国民办教育协会<br></p>                                                              <p><br></p>                                                                                                                            ','http://47.100.76.23/data/attach/topic/topic2k11iv.jpg',0,'admin',1,39,119,0,1537576882,0,0,0,0,1,1,''),(9,'葛为民会长调研杭州民办学校','\r\n                                 <p><img src=\"http://www.zjmbjy.net/UploadFile/image/20180921/20180921153741104110.jpg\" alt=\"\"></p><p>9月19日，省民办教育协会会长葛为民、副会长兼秘书长林晓鸣等赴杭州启正中学、杭州采荷实验学校，调研秋季开学和学习贯彻落实民办教育新法新政情况。</p><p><img src=\"http://www.zjmbjy.net/UploadFile/image/20180921/20180921153755595559.jpg\" alt=\"\"></p><p>在杭州启正中学，葛为民一行听取了该校新任校长杨士军等校领导就今年学校办学体制转换情况和学校抓安全稳定、促质量提升、推人才全面培养的做法及思路的汇报。葛为民对该校注重教学效果，开展与名家、阅读、创新、社会实践、研学“五个有约”活动，将学生的素质教育、全面发展寓于具体的实践过程给予高度评价。</p><p><img src=\"http://www.zjmbjy.net/UploadFile/image/20180921/2018092115380401401.jpg\" alt=\"\"></p><p>在杭州市采荷实验学校，葛为民一行饶有兴趣地听取了杭州采荷教育集团理事长、采荷中学首任校长何志英就该校从无到有、由小到大、由弱到强的艰难办学历程，高度赞赏该校在校长带领下，全体教职员工队伍多年来用坚持正确教育思想、无私奉献的精神、科学严谨的教学方法和顽强拼搏的斗志创建和打造一流学校所取得的成绩。</p><p></p><p>调研中，葛为民还就深入学习理解落实民办教育新法新政和加强与协会互动进行了交流。她指出：民办学校为使学生享受更好的优质教育，给老百姓提供多种选择付出了艰辛的努力。她鼓励学校发扬成绩，发挥优势，再接再厉，再创佳绩。（协会秘书处）</p><p><br></p><p>数据来源：浙江省民办教育协会</p>','http://47.100.76.23//data/attach/topic/topicpmSaWa.jpg',0,'admin',1,9,119,0,1537663315,0,0,0,0,1,1,''),(10,'民办教育促进法实施条例（修订草案）（送审稿）》征求意见建议座谈会在杭召开','\r\n                                    \r\n                                 <p><img src=\"http://www.zjmbjy.net/UploadFile/image/20180906/20180906143276427642.JPG\" alt=\"\"></p><p>9月5日，浙江省民办教育协会在杭州召开《中华人民共和国民办教育促进法实施条例（修订草案）（送审稿）》（下简称《实施条例（送审稿）》征求意见建议座谈会，听取我省民办教育界对《实施条例（送审稿）》的意见建议，全省30多位民办学校举办者、校长、专家到会。会议由省民办教育协会会长葛为民主持，常务副会长叶向群、副会长兼秘书长林晓鸣等出席。</p><p><img src=\"http://www.zjmbjy.net/UploadFile/image/20180906/20180906143315911591.JPG\" alt=\"\"></p><p>葛为民在座谈会上讲话，她充分肯定了大家多年来对民办教育政策的认真学习和积极建言献策。她指出，《实施条例（送审稿）》是对民办教育促进法和国务院《关于鼓励社会力量兴办教育促进民办教育健康发展的若干意见》的细化，政治性、政策性和可操作性都很强。司法部于8月10日发布了《实施条例（送审稿）》，用一个月时间广泛向社会各界征求意见建议，体现了国家对该项工作的重视，也体现了对民办教育界的信任。大家一定要珍惜机会，围绕主题，畅所欲言，集中智慧，为协会起草对《修订草案（送审稿）》意见建议提供实践依据。</p><p><img src=\"http://www.zjmbjy.net/UploadFile/image/20180906/20180906143320252025.JPG\" alt=\"\"></p><p>座谈会上，与会人员重点围绕《实施条例（送审稿）》中关于集团化办学、办学自主权、教职工待遇、税收优惠政策等内容进行了深入交流，对一些热点难点问题进行了充分讨论，提出了许多有价值的意见建议。（协会秘书处 张明怡）</p><p><br></p><p>数据来源：浙江省民办教育网</p><p><br></p>                                                              ','http://47.100.76.23/data/attach/topic/topicB6cVZb.jpg',0,'admin',1,22,119,0,1537664793,0,1,0,0,1,1,''),(11,'新西方介绍','\r\n                                 <p>梦想在哪里<br></p>','http://47.100.76.23//data/attach/topic/topicm0UIqn.jpg',0,'新西方语言教育',3546,11,148,0,1538034783,0,0,0,0,1,1,''),(12,'19年春天班火热招生','\r\n                                 <p>欢迎新朋友<br></p>','http://47.100.76.23//data/attach/topic/topicqI2jkI.jpg',0,'新西方语言教育',3546,22,149,0,1538034886,0,0,0,0,1,1,''),(13,'一篇机构自己发布的文章','\r\n                                 <p>这是一篇机构自己发布的文章，这里是正文</p>','http://47.100.76.23//data/attach/topic/topiccR0NiH.jpg',0,'宁波点通',3537,3,102,0,1538137374,0,0,0,0,1,1,''),(14,'这是某机构学校的介绍示例','\r\n                                    \r\n                                 <p>这是机构学校的介绍示例，正文</p><p>概况</p><p>师资</p><p>历史沿革</p><p>理念</p><p>学校远景</p><p><br></p>                                                         ','http://47.100.76.23/data/attach/topic/topicV2sape.jpg',0,'宁波点通',3537,7,148,0,1538137965,0,0,0,0,1,1,''),(15,'这是机构示例的招生简章','\r\n                                 <p>这是机构示例的招生简章，正文</p><p>招生对象：对象</p><p>待遇情况</p><p>学历要求：</p><p>其他要求：</p><p><br></p>','http://47.100.76.23//data/attach/topic/topic01xpJU.jpg',0,'宁波点通',3537,6,149,0,1538138014,0,0,0,0,1,1,''),(16,'我的第2篇学校介绍-0929','\r\n                                 <p>这是第2篇学校介绍，2018-9-29 21:6:41</p>','http://47.100.76.23//data/attach/topic/topicADM6be.jpg',0,'宁波点通',3537,7,148,0,1538226403,0,0,0,0,1,1,''),(17,'这是第2篇招生简章','\r\n                                 <p>这是第2篇招生简章，这是正文的内容</p>','http://47.100.76.23//data/attach/topic/topicGcVYVH.jpg',0,'宁波点通',3537,12,149,0,1538226455,0,0,0,0,1,1,''),(18,'这是一个测试文章，含地图功能','\r\n                                    \r\n                                    <p>这是一个测试文章，含地图功能</p><p>地图可以固定，可以活动，有2种模式</p><p><img src=\"http://api.map.baidu.com/staticimage?center=121.600524,29.867874&zoom=13&amp;width=478&amp;height=258&amp;markers=121.600524,29.867874|121.600524,29.867874\"><br></p><p><br></p>                                                                                                                  ','http://47.100.76.23/data/attach/topic/topickGv8AD.jpg',0,'宁波点通',3537,20,152,0,1538298726,0,0,0,0,1,1,''),(19,'这是一篇办学经验的分享文章','\r\n                                 <p>分享的文章正文，供在学校列表中显示3篇：经验、介绍、招生简章</p>','http://47.100.76.23//data/attach/topic/topicjEuT0v.jpg',0,'宁波点通',3537,8,153,0,1538472519,0,0,0,0,1,1,''),(20,'天气预报','\r\n                                 <p>今天天气晴朗</p>','http://47.100.76.23//data/attach/topic/topic6pWz0Z.jpg',0,'mr.梁',3547,3,100,0,1539006338,0,0,0,0,1,1,''),(21,'二遍','\r\n                                 <p>绘画</p>','http://47.100.76.23//data/attach/topic/topicfWe6xG.jpg',0,'mr.梁',3547,3,109,0,1539136062,0,0,0,0,1,1,'');

